import React, { Component, Fragment } from "react";
import "./HomePage.css";
import { Container, Row, Col } from "reactstrap";

class HomePage extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="body">
          <Container>
            <h2>Bienvenue dans le Wild Circus !</h2>
            <Row>
              <Col xs="6" sm="4">
                <p>Be Prepared</p>
              </Col>
            </Row>
          </Container>
        </div>
      </React.Fragment>
    );
  }
}

export default HomePage;
